export default function Pathmorphing() {
    const [index, setIndex] = useState(0);

    useEffect(() => {
        const interval = setInterval(() => {
            setIndex((i) => (i + 1) % icons.length);
        }, 6000);
        return () => clearInterval(interval);
    }, []);

    const current = icons[index];

    return (
        <div className="containerPathMorphing">
            <div className="pathMorphing">
                <svg
                    viewBox="0 0 800 800"
                    role="img"
                    className="pathSvg"
                    aria-label="Animated SVG icon morphing"
                    preserveAspectRatio="xMidYMid meet"
                    style={{ width: "60vw", height: "60vh" }}
                >
                    <AnimatePresence mode="wait">
                        <motion.path
                            key={index}
                            d={current?.d || ""}
                            fill={current?.color || "#000"}
                            initial={{ opacity: 0 }}
                            animate={{ opacity: 1 }}
                            exit={{ opacity: 0 }}
                            transition={{ duration: 1.5 }}
                        />
                    </AnimatePresence>
                </svg>
            </div>
        </div>
    );
}
